B.a7F=new A.as("Al enviar su direcci\xf3n de correo electr\xf3nico en esta plataforma, acepta recibir nuestros correos electr\xf3nicos. Puede cancelar su participaci\xf3n en cualquiera de estas listas de correo electr\xf3nico en cualquier momento haciendo clic en el enlace de exclusi\xf3n voluntaria u otra opci\xf3n para cancelar la suscripci\xf3n que se incluye en el correo electr\xf3nico respectivo. Solo enviamos correos electr\xf3nicos a personas que nos han autorizado a contactarlos, ya sea directamente o a trav\xe9s de un tercero. No enviamos correos electr\xf3nicos comerciales no solicitados, porque odiamos el spam tanto como usted. Al enviar su direcci\xf3n de correo electr\xf3nico, tambi\xe9n acepta permitirnos usar su direcci\xf3n de correo electr\xf3nico para la orientaci\xf3n de la audiencia del cliente en sitios como Facebook, donde mostramos publicidad personalizada a personas espec\xedficas que han optado por recibir nuestras comunicaciones. Las direcciones de correo electr\xf3nico enviadas solo a trav\xe9s de la p\xe1gina de procesamiento de pedidos se utilizar\xe1n con el \xfanico prop\xf3sito de enviarle informaci\xf3n y actualizaciones relacionadas con su pedido. Sin embargo, si nos ha proporcionado el mismo correo electr\xf3nico a trav\xe9s de otro m\xe9todo, podemos usarlo para cualquiera de los fines establecidos en esta Pol\xedtica. Nota: Si en alg\xfan momento desea cancelar la suscripci\xf3n para no recibir correos electr\xf3nicos futuros, incluimos instrucciones detalladas para cancelar la suscripci\xf3n en la parte inferior de cada correo electr\xf3nico.",null,B.o,null)
